import React from 'react';


function Card(props) {
  const { poster_path, title, overview } = props.movie;
  return (
    <div className="card">
  	  <img src={`http://image.tmdb.org/t/p/original/${poster_path}`} />
  	  <p>{title}</p>
  	  <p>{overview}</p>        
    </div>
  );
}

export default Card;
